DROP DATABASE Library
GO 

CREATE DATABASE Library
GO 

USE Library
GO

IF OBJECT_ID('dbo.Writers', 'U') IS NOT NULL  DROP TABLE dbo.Writers
GO
IF OBJECT_ID('dbo.Categories', 'U') IS NOT NULL  DROP TABLE dbo.Categories
GO
IF OBJECT_ID('dbo.Shelf', 'U') IS NOT NULL  DROP TABLE dbo.Shelf
GO
IF OBJECT_ID('dbo.Borrowers', 'U') IS NOT NULL  DROP TABLE dbo.Borrowers
GO
IF OBJECT_ID('dbo.Borrowing_history_log', 'U') IS NOT NULL  DROP TABLE dbo.Borrowing_history_log
GO
IF OBJECT_ID('dbo.Membership', 'U') IS NOT NULL  DROP TABLE dbo.Membership
GO
IF OBJECT_ID('dbo.Books', 'U') IS NOT NULL  DROP TABLE dbo.Books
GO
IF OBJECT_ID('dbo.Borrowing_history', 'U') IS NOT NULL  DROP TABLE dbo.Borrowing_history
GO


CREATE TABLE Writers
(
writer_id			int identity(1000,1),
writer_firstName	nvarchar(20)		CONSTRAINT writer_firstName_nnull NOT NULL,
writer_lastName		nvarchar(20)
	CONSTRAINT writer_id_pk				PRIMARY KEY(writer_id),
	CONSTRAINT first_last_name_unique	UNIQUE(writer_firstName,writer_lastName)
)
CREATE TABLE Categories
(
category_id				int identity(1,1),
category_name			nvarchar(40)			CONSTRAINT category_name_nnull NOT NULL,
category_classification	nvarchar(40)
	CONSTRAINT category_id_pk					PRIMARY KEY(category_id),
	CONSTRAINT category_name_unique				UNIQUE(category_name)
)
CREATE TABLE Shelf
(
shelf_id		int,
section_name	nvarchar(20)
	CONSTRAINT shelf_and_section_pk		PRIMARY KEY(shelf_id,section_name)
)
CREATE TABLE Borrowers
(
borrower_id				int,
borrower_firstName		nvarchar(20)	CONSTRAINT borrower_firstName_nnull NOT NULL,
borrower_lastName		nvarchar(20),
borrower_phoneNumber	varchar(25),
borrower_email			nvarchar(40),
borrower_birthdate		date
	CONSTRAINT borrower_id_pk			PRIMARY KEY(borrower_id),
	CONSTRAINT borrower_email_valid		CHECK(borrower_email LIKE '%_@_%.__%'
										AND PATINDEX('%[^a-z,0-9,@,.,_,-]%', borrower_email) = 0)
)
CREATE TABLE Membership
(
membership_id			int identity(1,1),
membership_startDate	date,
membership_endDate		date,
membership_isPaid		bit DEFAULT 0,
payment_date			date,
borrower_id				int						CONSTRAINT borrower_id_nnull NOT NULL
	CONSTRAINT membership_id_pk					PRIMARY KEY(membership_id),
	CONSTRAINT membership_endDate_chronology	CHECK(membership_endDate>membership_startDate),
	CONSTRAINT borrower_id_fk					FOREIGN KEY (borrower_id) REFERENCES Borrowers(borrower_id)
)
CREATE TABLE Books
(
book_id			int identity(1,1),
copy_number		smallint,
book_name		nvarchar(150),
publish_date	date,
writer_id		int,
category_id		int,
shelf_id		int,
section_name	nvarchar(20)
CONSTRAINT book_id_copy_number_pk		PRIMARY KEY(book_id,copy_number),
CONSTRAINT writer_id_fk					FOREIGN KEY (writer_id)		REFERENCES Writers(writer_id),
CONSTRAINT category_id_fk				FOREIGN KEY (category_id)	REFERENCES Categories(category_id),
CONSTRAINT shelf_section_id_fk					FOREIGN KEY (shelf_id,section_name)		REFERENCES Shelf(shelf_id,section_name)
)
CREATE TABLE Borrowing_history
(
borrowing_id	int identity(1,1),
start_date		date,
end_date		date,
book_id			int						CONSTRAINT book_id_nnull NOT NULL,
copy_number		smallint				CONSTRAINT copy_number_nnull NOT NULL,
borrower_id		int						CONSTRAINT borrower_id_nnull NOT NULL
	CONSTRAINT borrowing_id_pk			PRIMARY KEY(borrowing_id),
	CONSTRAINT end_date_chronology		CHECK(end_date>start_date),
	CONSTRAINT book_id_copy_number_fk	FOREIGN KEY(book_id,copy_number) REFERENCES Books(book_id,copy_number),
	CONSTRAINT borrowers_id_fk			FOREIGN KEY(borrower_id) REFERENCES borrowers(borrower_id)
)
CREATE TABLE Borrowing_history_log
(
log_id		 int identity(1,1),
book_id		 int,
borrower_id	 int,
start_date	 date,
end_date	 date
	CONSTRAINT log_id_pk PRIMARY KEY(log_id)
)

